import EmpTable from "./Emp Table";
import { BrowserRouter as Router,Routers,Route,Link } from "react-router-dom";

function King(){
    return(
        <div>
          <Router>
            <Routers>
                <Route path="/" element={<EmpTable/>}>
                    
                </Route>
            </Routers>
          </Router>
        </div>
    )
}
export default King;
